function compare(a, b) {
    if (a === b) {
        console.log("PASS");
    } else {
        console.log("FAIL");
    }
}

function a1_test(desc, graph, expected) {
    let hegraph = new HEGraph(graph);
    let actual = hegraph.getFaceIds();
    console.log(desc);
    console.log("   Input:", graph);
    console.log("   Expected:", expected);
    console.log("   Actual:", actual);
    console.log("   Face Objects:", hegraph.getFaces());
    compare(expected.toString(), actual.toString());
    console.log();
}

function algorithm1_tests() {
    console.log("---Algorithm 1 Tests---")
    // test 1
    let desc = "TEST 1 - A simple test that draws two faces from four vertices and returns the face identifiers";
    let expected = [0, 1];
    a1_test(desc, graph2, expected);

    // test 2
    desc = "TEST 2 - A test that draws four triangular faces where five edges converge on one point";
    expected = [0, 1, 2, 3];
    a1_test(desc, graph1, expected);

    // test 3
    desc = "TEST 3 - Tests a graph where edges are drawn out of order";
    expected = [0, 1, 2, 3, 4];
    a1_test(desc, graph3, expected);

    // test 4
    desc = "TEST 4 - Tests a graph where vertices may have both parallel and non-parallel outgoing edges. This was a bug in my original vertex sorting function.";
    expected = [0, 1, 2, 3, 4, 5, 6, 7, 8];
    a1_test(desc, graph6, expected);

    // test 5
    desc = "TEST 5 - Tests a graph containing a concave face";
    expected = [0, 1, 2];
    a1_test(desc, graph11, expected);
}

function a2_test(desc, faceId, graph, expected) {
    let hegraph = new HEGraph(graph);
    let actual = hegraph.getFace(faceId).getNeighbors();
    console.log(desc);
    console.log("   Input:", faceId);
    console.log("   Expected:", expected);
    console.log("   Actual:", actual);
    compare(expected.toString(), actual.toString());
    console.log();
}

function algorithm2_tests() {
    console.log("---Algorithm 2 Tests---")
    // test 1
    let desc = "TEST 1 - A simple test that finds the neighboring face of a graph with two faces";
    let faceId = 0;
    let expected = [1];
    a2_test(desc, faceId, graph2, expected);

    // test 2
    desc = "TEST 2 - Tests if faces that only touch at a Vertex will be ignored when choosing neighbors";
    faceId = 1;
    expected = [6, 5];
    a2_test(desc, faceId, graph4, expected);

    // test 3
    desc = "TEST 3 - Tests a concave face";
    faceId = 1;
    expected = [0];
    a2_test(desc, faceId, graph11, expected);

    // test 4
    desc = "TEST 4 - Tests a larger grid graph with randomized vertex locations";
    faceId = 250;
    expected = [226, 251, 274, 249];
    a2_test(desc, faceId, graph8, expected);
}

function a3_test(desc, point, graph, expected) {
    let hegraph = new HEGraph(graph);
    let actual = hegraph.pointInGraph(point);
    console.log(desc);
    console.log("   Input point:", point);
    console.log("   Expected face id:", expected);
    console.log("   Actual face id:", actual);
    compare(expected, actual);
    console.log();
}

function algorithm3_tests() {
    console.log("---Algorithm 3 Tests---");
    // test 1
    let desc = "TEST 1 - Tests which face the point is in for a graph with only two faces";
    let point = [1, 0.5];
    let expected = 0;
    a3_test(desc, point, graph2, expected);

    // test 2
    desc = "TEST 2 - Tests a point that lies outside of a graph (algorithm returns null)";
    point = [3, 2];
    expected = null;
    a3_test(desc, point, graph11, expected);

    // test 3
    desc = "TEST 3 - Tests which face a point is in for a larger graph with only orthogonal edges";
    point = [12.3, 22.4];
    expected = 540;
    a3_test(desc, point, graph7, expected);
}

function a4_test(desc, faceId, graph, expectedLayerCount, expectedLayers) {
    let hegraph = new HEGraph(graph);
    let layers = hegraph.computeLayers(faceId);
    let expectedFaceCount = 0;
    let actualFaceCount = 0;
    console.log(desc);
    console.log("   Input face id:", faceId);
    console.log("   Expected number of layers:", expectedLayerCount);
    console.log("   Actual number of layers:", layers.length);
    compare(expectedLayerCount, layers.length);

    console.log("   Expected layers:");
    for (let i = 0; i < expectedLayerCount; i++) {
        console.log("      ", expectedLayers[i]);
        expectedFaceCount += expectedLayers[i].length;
    }
    console.log("   Actual layers:");
    for (let i = 0; i < layers.length; i++) {
        console.log("      ", layers[i]);
        actualFaceCount += layers[i].length;
    };
    compare(expectedLayers.toString(), layers.toString());

    console.log("   Expected total face count:", expectedFaceCount);
    console.log("   Actual total face count:", actualFaceCount);
    compare(expectedFaceCount, actualFaceCount);

    console.log();
}

function algorithm4_tests() {
    console.log("---Algorithm 4 Tests---");
    // test 1
    let desc = "TEST 1 - Tests a graph containing faces that touch only on their vertices that shouldn't be included as face neighbors";
    let faceId = 0;

    let expectedLayerCount = 5;
    let expectedLayers = [[0], [5,4], [1,8,3], [6,7], [2]];
    a4_test(desc, faceId, graph4, expectedLayerCount, expectedLayers);

    // test 2
    desc = "TEST 2 - Tests the same graph as the previous test, but starting from the center";
    faceId = 8;
    expectedLayerCount = 3;
    expectedLayers = [[8], [5,6,7,4], [0,1,2,3]];
    a4_test(desc, faceId, graph4, expectedLayerCount, expectedLayers);

    // test 3
    desc = "TEST 3 - Tests a graph with a concave face where each face has a single neighbor";
    faceId = 1;
    expectedLayerCount = 3;
    expectedLayers = [[1], [0], [2]];
    a4_test(desc, faceId, graph11, expectedLayerCount, expectedLayers);
}

